import React from "react";
import Card from "react-bootstrap/Card";

const mockSummits = [
  {
    name: "Rasletind",
    height: 2105,
    rating: 10,
  },
  {
    name: "Mugnetind",
    height: 1750,
    rating: 5,
  },
  {
    name: "Mount Everest",
    height: 8848,
    rating: 6,
  },
];

const Summits = () => {
  const summits = mockSummits;
  summits.forEach((summit) => console.log(summit));
  return (
    <div>{summits && summits.map((summit) => <Card>{summit.name}</Card>)}</div>
  );
};

export default Summits;
